import './App.css';
import { useState } from 'react';

function App() {

  const [getList, setList] = useState([{
    stage:"Request submitted",
    city:"New york",
    stage:"completed"
  },
  {
    stage:"Package received",
    city:"New york",
    stage:"progress"
  }

]);

  return (
    <div className="container">
      {getList.map((obj,index) => {
        return (<div className="box" keys={index}>
           <div className={index%2==0?'full-circle':'outer-circle-grey'}></div>
          <div className={index%2==0?'vertical-line-blue':'vertical-line-grey'}></div> 
        </div>)
      })}


    </div>
  )
}

export default App;
